import logo from './logo.svg';
import React, { Component } from 'react'
import Headers from './Headers'
import Body from './Body'
import Footers from './Footers'
import './App.css';
import axios from "axios";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";

var suggestions = [{
  active: false,
  description: "San Francisco, CA, USA",
  formattedSuggestion: { mainText: "San Francisco", secondaryText: "CA, USA" },
  id: "1b9ea3c094d3ac23c9a3afa8cd4d8a41f05de50a",
  index: 0,
  matchedSubstrings: [ {length: 8, offset: 0} ],
  placeId: "ChIJIQBpAG2ahYAR_6128GcTUEo",
  terms: [
    { offset: 0, value: "San Francisco" },
    { offset: 15, value: "CA" },
    { offset: 19, value: "USA" }
  ],
  types: ["locality", "political", "geocode"]
}]
class home extends Component {
  constructor(props) {
    super(props);

    this.state = {
      profil: "visiteur",
      address: "",
      dataInit: []
    }
    this.renderFunc = this.renderFunc.bind(this);
  }
    /*allResults() {
      var b = document.querySelector("header");
      b.setAttribute("padding-top", "0%");
      axios.get ("http://localhost:5000/").then(res => {
        this.setState({dataInit: res.data.data}) 
      });
    }*/
    /*autocompleteCity() {
      var options = {
       types: ['(cities)'],
       componentRestrictions: {country: "us"}
      };
      var input = document.getElementById('searchTextField');
      var autocomplete = new google.maps.places.Autocomplete(input, options);
     }*/
     /*renderFunc = ({ getInputProps, getSuggestionItemProps, suggestions }) => (
      <div className="autocomplete-root">
        <input {...getInputProps({className: 'my-input', autoFocus: true })} />
        <div className="autocomplete-dropdown-container">
          {loading && <div>Loading...</div>}
          {suggestions.map(suggestion => (
            <div {...getSuggestionItemProps(suggestion)}>
              <span>{suggestion.description}</span>
            </div>
          ))}
        </div>
      </div>
    );*/

    render() {
      const {profil, dataInit} = this.state
      return (
        <div className="App">
          <Headers profil={profil} where={"home"}/>
          <Body profil={profil} project={dataInit} suggestions={suggestions}/>
          <Footers profil={profil}/>
        </div>
      )
    }
  }

export default home;
